INSERT INTO public."MultiResponseQuestions"("Id", "Text") VALUES
	(-1000, 'Označi istinite izjave za proces rada na projektnom zadatku:');
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-10000, 'Dekompozicija korisničkih priča se dešava na vežbama.', false, 'Izjava nije istinita. Dekompozicija priča se dešava nakon vežbi, kada timovi prave samostalan sastanak koji vodi Scrum master da se razloži i raspodeli posao za sprint.', -1000);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-10001, 'Svake nedelje je neophodno napraviti inkrement u radu.', true, 'Iako se konačni poeni dobijaju tokom revizije sprinta, neophodno je napraviti pomak svake nedelje. Ovo podrazumeva da je urađeno barem 50% planiranog posla za tu nedelju, što se u praksi svede na nekoliko sati rada. Ovaj progres je bitan kako bi se otvorila nova pitanja koja se mogu postaviti na predavanjima i vežbama.', -1000);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-10002, 'Tim organizuje retrospektivu nakon što dobije poene na vežbama', false, 'Izjava nije istinita. Iako se u praksi retrospektiva organizuje nakon revizije, zbog organizacionih ograničenja želimo da tim napravi retrospektivu pre revizije sprinta i da uključi zaključke iz retrospektive u svoj izveštaj.', -1000);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-10003, 'Prilikom planiranja rada, tim treba da uračuna sve obaveze koje članovi tima imaju u predstojećim nedeljama.', true, 'Izjava je istinita. Tim treba da obrati pažnju na druge kolokvijume i kontrolne tačke, kao i na zaostale ispite kako bi postigao željene rezultate. Konačan rezultat će biti osmočasovni radni dan tokom semestra. Nepažljivi timovi će dozvoliti da se obaveze nagomilaju pa će morati da rade overtime i vikendom ako žele da postignu dobre rezultate.', -1000);
INSERT INTO public."AssessmentItems"("Id", "KnowledgeComponentId", "Order") VALUES
	(-999, -100, 2);
INSERT INTO public."MultiResponseQuestions"("Id", "Text") VALUES
	(-999, 'Označi istinite izjave za ulogu Scrum mastera u sklopu projektnog zadatka:');
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9990, 'Svaki član tima treba da bude Scrum master bar za 1 sprint.', true, 'Izjava je istinita. Najbolje bi bilo da najiskusniji inženjer preuzme ovu ulogu za prvi sprint i postavi primer za ostale članove.', -999);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9991, 'Student koji je Scrum master ima više posla u datom sprintu od ostatka tima.', false, 'Izjava nije istinita. Scrum master ima određene odgovornosti koje treba savesno da sprovede, što zahteva vreme. Zbog ovog posla bi trebao da preuzme nešto manje inženjerskog posla kako bi opterećenje bilo ravnomerno raspoređeno.', -999);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9992, 'Scrum master treba da proziva druge članove tima tokom sastanka i online kanala.', true, 'Izjava je istinita. "Prozivanje" znači da treba periodično (npr. jednom u tri dana) da svakog člana tima kontaktira (telefonom ili online). Cilj je da dobije informaciju da posao napreduje dobrim tempom i da nema problema ili nepoznanica koje ugrožavaju napredak tima.', -999);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9993, 'Scrum master je odgovoran za kvalitet završnog izveštaja u sprintu.', true, 'Izjava je istinita. Svaki član tima treba svojim trudom da doprinese rezultatima sprinta, no Scrum master je taj koji će sve to sabrati u konačni izveštaj koji će se prezentovati na reviziji sprinta.', -999);
INSERT INTO public."AssessmentItems"("Id", "KnowledgeComponentId", "Order") VALUES
	(-998, -99, 1);
INSERT INTO public."MultiResponseQuestions"("Id", "Text") VALUES
	(-998, 'Iz sledećeg spiska izjava označi one koje ulaze u "definiciju uspeha" za sve kontrolne tačke koje te čekaju u sklopu ovog predmeta.');
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9980, 'Dogovorene funkcionalnosti treba implementirati i revidirati do dana kada je kontrolna tačka.', true, 'Izjava je istinita. Ako su funkcionalnosti ispravno implementirane, asistent će prihvatiti zadatak kao ispunjen na samoj kontrolnoj tački ili na vežbama koje joj prethode.', -998);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9981, 'Svaka funkcionalnost treba da bude pokrivena bar sa jednim automatskim testom.', false, 'Izjava ne važi za prvi sprint, ali važi za preostala tri. Kada budemo radili TDD videćemo kako možemo napraviti "acceptance test" za funkcionalnost.', -998);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9982, 'Svaki inkrement u kodu mora biti revidiran bar od strane jednog inženjera koji nije radio na tom kodu.', true, 'Izjava je istinita. Koristeći "pull request" mehanizam, svaka izmena treba da bude revidirana od strane jednog inženjera koji nije autor koda. Ova praksa povećava kvalitet koda i takođe povećava svest drugih članova tima o funkcionalnostima koje postoje u kodu.', -998);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9983, 'Svaka veća funkcionalnost treba da ima svoju wiki stranicu na GitHubu koja je dokumentuje.', false, 'Izjava nije istinita. Neki oblik dokumentacije je koristan za rad tima, a takođe će doprineti konačnom demou, no ovo nije neophodan uslov za uspešno završavanje kontrolne tačke.', -998);
INSERT INTO public."AssessmentItems"("Id", "KnowledgeComponentId", "Order") VALUES
	(-997, -99, 2);
INSERT INTO public."MultiChoiceQuestions"("Id", "Text", "PossibleAnswers", "CorrectAnswer", "Feedback") VALUES
	(-997, 'Zamislimo da imamo 6 funkcionalnosti (F1-F6) koje treba da rešimo. Date funkcionalnosti imaju sledeće osobine:
INSERT INTO public."AssessmentItems"("Id", "KnowledgeComponentId", "Order") VALUES
	(-996, -99, 3);
INSERT INTO public."MultiResponseQuestions"("Id", "Text") VALUES
	(-996, 'U nastavku sledi spisak *rizika* koji se mogu ostvariti u sklopu PSW projekta. Označi one koje smatraš da su veoma izazovni za umanjivanje jer su generalno van tvoje kontrole.');
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9960, 'Zbog nejasnih zahteva se implementira pogrešna funkcionalnost i to dovodi do gubitka poena na kontrolnoj tački.', false, 'Dati rizik je lako umanjiti redovnim radom, posebno na početku svakog sprinta. Svakoj kontrolnoj tački predstoji 1-2 vežbe i isto toliko predavanja gde se može potvrditi razumevanje zahteva pre nego što dođe ocenjivanje. Radom će se otkriti pitanja i nejasnoće koje se onda mogu otkloniti.', -996);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9961, 'Neočekivani bag zaustavlja razvoj i donosi veliki gubitak vremena koji negativno utiče na rezultat rada.', false, 'Tehnologije i projekat sa kojim radimo nije dovoljno složen da ima izazovne bagove u prva dva sprinta. Posle toga bi automatski testovi trebali da nam pomognu da lako identifikujemo bag pre nego što postane problem. Pod našom je kontrolom da pišemo dobre testove i da tražimo pomoć od kolega kada naiđemo na bag koji nam stvara muku.', -996);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9962, 'Slab angažman člana tima dovodi do loših rezultata na kraju kompletnog projektnog zadatka.', false, 'Tim treba da identifikuje na nedeljnom nivou da li postoje problemi u progresu rada svakog člana tima. Svaki član tima ima moć da podigne uzbunu kada drugi član tima ne doprinosi. Ovakav problem se rešava unutar tima kada je moguće, a uz pomoć asistenta ili profesora kada nije. U svakom slučaju bi bilo kakva šteta zbog nerada kolege trebala da bude minimalna i na nivou jednog sprinta, a nikako na nivou čitavog projekta.', -996);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9963, 'Loša kultura u timu dovodi do niskog stepena komunikacije i slabih zajedničkih rezultata.', false, 'Svaki član tima je odgovoran za kulturu rada u timu. Ako je komunikacija slaba, imaš moć da organizuješ druženja kako bi se poboljšali timski odnosi. Ako je disciplina loša, imaš moć da organizuješ kratke sastanke na nekoliko dana da se razmatra progres svakog člana.', -996);
INSERT INTO public."AssessmentItems"("Id", "KnowledgeComponentId", "Order") VALUES
	(-995, -98, 1);
INSERT INTO public."MultiResponseQuestions"("Id", "Text") VALUES
	(-995, 'Označi istinite izjave koje se odnose na **vodopad** metodologiju razvoja softvera.');
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9950, '"Vodopad" podrazumeva niz praksi koji uključuje inženjering zahteva, nakon čega ide specifikacija dizajna, pa implementacija, pa testiranje i onda postavka u produkciju. Najzad, sledi održavanje postavljenih funkcionalnosti.', true, 'Izjava je istinita. Ovo su standardne SDLC prakse koje srećemo kod razvoja softvera.', -995);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9951, 'Izazovno je planirati dužinu trajanja faze u "Vodopad" metodologiji.', true, 'Izjava je istinita. Planiranje u okviru ove metodologije je na dužoj vremenskoj skali, što dovodi do veće nesigurnosti u plan. Posledično nastaju problemi u realizaciji da jedna faza traje duže ili kraće od planiranog, što dovodi do neefikasnog razvoja.', -995);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9952, '"Vodopad" predviđa da nakon implementacije radimo refaktorisanje i potom se vratimo na specifikaciju dizajna.', false, 'Izjava nije istinita. Vodopad je definisan time što faze idu u nizu i nema povratka na ranije korake nakon što su završeni.', -995);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9953, 'Ako su faze "Inženjeringa zahteva" i "Specifikacije dizajna" ispravno urađene, možemo biti sigurni da će ostatal "vodopada" da se sprovede po planu.', false, 'Izjava nije istinita. Iako su date prakse veoma bitne za ostatak SDLCa, sasvim je moguće da se implementacija ranije završi ili da se prilikom testiranja otkriju ozbiljni problemi koji će zahtevati produženje date faze.', -995);
INSERT INTO public."AssessmentItems"("Id", "KnowledgeComponentId", "Order") VALUES
	(-994, -98, 2);
INSERT INTO public."MultiResponseQuestions"("Id", "Text") VALUES
	(-994, 'Označi istinite izjave koje se odnose na **agilne** metodologije razvoja softvera.');
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9940, '"Agile" podrazumeva ciklus praksi koji uključuje inženjering zahteva, nakon čega ide specifikacija dizajna, pa implementacija, pa testiranje i onda postavka u produkciju. Najzad, sledi održavanje postavljenih funkcionalnosti.', true, 'Izjava je istinita. Ovo su standardne SDLC prakse koje srećemo kod razvoja softvera, pa i kod agilnih metodologija. Razlika u odnosu na vodopad je što je ciklus po kom se ove prakse smenjuju kratak (nekoliko dana ili nedelja).', -994);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9941, 'Izazovno je planirati dužinu trajanja faze u "Agile" metodologiji.', false, 'Izjava nije istinita. Planiranje u okviru ove metodologije je na kratkoj vremenskoj skali, što dovodi do manje nesigurnosti u plan. Ovo ne znači da su planovi idealni i svakako se može desiti da neki posao traje kraće ili duže od planiranog, no izazov planiranja je relativno jednostavan.', -994);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9942, 'Problemi koji su prisutni u "Vodopad" metodologiji postoje i u "Agile" metodologiji.', true, 'Izjava je istinita. Zbog ovoga je bitno razumeti nedostatke koje Vodopad ima i obratiti pažnju da naš proces rada što manje pati od datih problema.', -994);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9943, '"Agile" se fokusira na formiranje konciznog plana i ne gubi vreme na planiranje.', false, 'Struktura sprintova često rezultuje minimalnim planom koji se sastoji od nekoliko kartica sa zahtevima. Akcenat je upravo na procesu planiranja kako bi se razvoj usmerio ka najvrednijim rezultatima.', -994);
