	(-993, -97, 1);
INSERT INTO public."ArrangeTasks"("Id", "Text") VALUES
	(-993, 'Poveži sledeći spisak odgovornosti sa ulogama u Scrum radnom okviru koje su najviše zaslužne za ispune datu odgovornost.');
INSERT INTO public."ArrangeTaskContainers"("Id", "ArrangeTaskId", "Title") VALUES
