INSERT INTO public."ArrangeTaskElements"("Id", "ArrangeTaskContainerId", "Text", "Feedback") VALUES
	(-99300,-9930, 'Definiše želje koje softverski sistem treba da ispuni', 'Naši klijenti ili stakeholderi će biti ti koji donose želje na sto. Ponekad su te želje nepromišljene i druge želje se kriju ispod površine koje treba Scrum tim da otkrije. Na kraju dana ono što klijent želi je ono što treba da dobije.');
INSERT INTO public."ArrangeTaskContainers"("Id", "ArrangeTaskId", "Title") VALUES
	(-9931, -993, 'Product Owner');
INSERT INTO public."ArrangeTaskElements"("Id", "ArrangeTaskContainerId", "Text", "Feedback") VALUES
	(-99310,-9931, 'Razrađuje viziju softverskog sistema', 'Product owner provodi značajnu količinu vremena razmišljajući o proizvodu. Kroz razgovor sa klijentom, istraživanjem tržišta i generalnom brainstorming-u, product owner stalno unapređuje viziju najvrednijeg proizvoda koji može da se napravi.');
INSERT INTO public."ArrangeTaskElements"("Id", "ArrangeTaskContainerId", "Text", "Feedback") VALUES
	(-99311,-9931, 'Prioritizuje zadatke', 'Product owner u razgovoru sa klijentom i razvojnim timom određuje najbitnije aktivnosti koje tim treba da sprovede.');
INSERT INTO public."ArrangeTaskContainers"("Id", "ArrangeTaskId", "Title") VALUES
	(-9932, -993, 'Scrum Master');
INSERT INTO public."ArrangeTaskElements"("Id", "ArrangeTaskContainerId", "Text", "Feedback") VALUES
	(-99320,-9932, 'Vodi sastanke i inicira komunikaciju sa svakim članom tima', 'Scrum master treba da "pinga" mišljenje od svakog člana tima, jer se lako se može desiti da pasivni deo tima krene manje da doprinosi. Posledično, tim gubi deo ideja koje be doprineli pasivni ljudi, dok dati pojedinci formiraju slabiju vezu ka kolektivu.');
INSERT INTO public."ArrangeTaskElements"("Id", "ArrangeTaskContainerId", "Text", "Feedback") VALUES
	(-99321,-9932, 'Stara se da ne postoji posao koji nije raspoređen na nekog člana tima', 'Scrum master vodi računa o spisku zadataka za određeni sprint i stara se da je svaki zadatak dodeljen nekome, kao i da taj neko ima potrebno znanje i pomoć da ispuni zadatak.');
INSERT INTO public."ArrangeTaskContainers"("Id", "ArrangeTaskId", "Title") VALUES
	(-9933, -993, 'Svaki član tima');
INSERT INTO public."ArrangeTaskElements"("Id", "ArrangeTaskContainerId", "Text", "Feedback") VALUES
	(-99330,-9933, 'Ne dozvoljava da problem u timu ostane nerazmotren duže vreme', 'Svaki član tima je odgovoran za svoj tim i kulturu njegovog rada. Kada se problem identifikuje neophodno je razgovarati i razumeti razlog zašto problem postoji. Čest razlog nesporazuma su različita očekivanja koja nisu dovoljno dobro iskomunicirana.');
INSERT INTO public."ArrangeTaskElements"("Id", "ArrangeTaskContainerId", "Text", "Feedback") VALUES
	(-99331,-9933, 'Pomaže članu tima da se izbori sa izazovom', 'Svaki član tima treba da izdvaja deo svog vremena da pomogne kolegama. Posledica ovakvog čina je razvoj komunikacione veštine onog koji pomaže, tehničke ekspertize onog koji prima pomoć i pozitivne energije u timu koja doprinosi njegovom kontinualnom rastu.');
