	(-990, 'U sklopu koje aktivnosti bi tim mogao da razmatra opciju uvođenja novog plagina u integrisano razvojno okruženje svakog člana tima i njegovu primenu u narednom periodu?', '{"Sprint review","Sprint retrospective","Daily scrum","Sprint planning","Ništa od navedenog"}', 'Sprint retrospective', ' Retrospektiva je vreme kada se razmišlja kako da se unapredi način rada - bilo da je uvođenje novog alata ili novog načina komunikacije. Šta god se odluči je bitno disciplinovano primenjivati do sledeće retrospektive kako bi se mogao smisleno analizirati efekat promene.');
