INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9883, 'Sprint retrospektiva', true, 'Data aktivnosti doprinosi. Na kraju svakog sprinta tim može da analizira koje korisničke priče su procenili da su nezavisne pa se ispostavilo da ipak nekih zavisnosti ima. Kroz retrospektivu se utvrđuju stečene lekcije i povećava se veština izgradnje nezavisnih priča.', -988);
