	(-9863, 'Sprint retrospektiva', true, 'Data aktivnosti doprinosi budućim estimacijama. Na kraju svakog sprinta tim može da analizira koje korisničke priče su pogrešno estimirane i razloge zašto se to desilo. Ovako utvrđene lekcije doprinose razvoju veština za estimaciju posla.', -986);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
