	(-985, 'Označi istinite izjave u kontekstu definisanja prednosti i mana korisničkih priča u odnosu na slučajeve korišćenja:');
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9850, 'Prednost korisničke priče je što ostavlja pisani trag kojim pravdamo posao', false, 'Izjava nije istinita. Priče nisu pogodan dokument za bilo kakav dokaz zbog svoje fleksibilne forme. "Lekar želi da vidi spisak pacijenata" se može realizovati kroz 10 minuta posla ili 10 sati posla u zavisnosti od detalja vezanih za datu funkcionalnost, koji se često određuju kroz razgovor.', -985);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9851, 'Korisničke priče nisu pogodne kada imamo retku interakciju sa klijentom ili product ownerom.', true, 'Izjava je istinita. Zbog svog šturog oblika i nedostatka komunikacije često nećemo znati šta treba uraditi, te je bolje dokumentovati zahteve u nekom detaljnijem obliku.', -985);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9852, 'Korisničke priče su poziv na razgovor', true, 'Izjava je istinita. Zbog svoje fleksibilnosti klijent ulazi u dijalog sa razvojnim timom gde se beleže ideje kako najbolje odgovoriti na želju koja je izražena u priči.', -985);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9853, 'Korisniče priče generalno nisu dobar vid dokumentacije zahteva', true, 'Izjava je istinita. Ako nam je bitno da na duže staze beležimo šta je rađeno ili da komuniciramo o zahtevima asinhrono putem mailova, bolje je koristiti složeniji oblik dokumentacije poput slučajeva korišćenja.', -985);
