INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9840, 'Bitno je razumeti "rolu" na koju se odnosi priča kako bismo lakše razložili priču na pojedinačne zadatke', false, 'Izjava nije istinita. Rola nam služi za usmeravanje načina kako ćemo rešiti zadatke, no sami zadaci su primarno definisani ciljem korisnika.', -984);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9841, 'Bitno je razumeti "korist" koja se stvara rešavanjem priče kako bismo ispitivali smislenost i prioritet priče', true, 'Izjava je istinita. "Korist" je najteže definisati, no bitan je zadatak ako želimo da uradimo dobar posao. Često ćemo definisati priču sa pogrešnom idejom da donosimo korist klijentu. "Želim funkcionalnost X kako bi skratio vreme potrebno da se uradi posao Z" nam omogućava da postavimo pitanje "da li je funkcionalnost X najbolji način da se skrati vreme potrebno za posao Z? Da li je Y bolji način da se postigne ta korist?"', -984);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9842, '"PDF izveštaj plate radnika" je previše štur opis za korisničku priču.', false, 'Izjava nije istinita. Kada tim ima svakodnevni pristup klijentu ili product owneru i razrađeno poverenje i komunikaciju, data priča može biti dovoljna za potrebe tima. Ozbiljnost opisa je obrnuto srazmerna frekvenciji komunikacije i stepenu poverenja - ako pričamo sa klijentom jednom u dve nedelje i imamo problema da definiše opseg posla neophodno je da se "branimo" ozbiljnijim dokumentima.', -984);
