	(-9830, 'Scrum tim zajedno sa stakeholderima treba da definiše ciljeve organizacije za koje se pravi softver.', false, 'Izjava nije istinita. Organizacioni ciljevi nastaju u organizacijama naših klijenata pre nego što se uopšte razmatra izgradnja nekakvog softvera.', -983);
