INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9832, 'Product owner zajedno sa stakeholderima treba da definiše krupne ideje za softver (epic-e).', true, 'Izjava je istinita. Kada se klijent odluči da određene organizacione promene podrži softverom, product owner ima zadatak da kroz niz razgovora (u okviru planiranja projekta) definiše krupne epice softvera i načelne funkcionalnosti koje treba da podrži.', -983);
INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9833, 'Scrum tim zajedno sa stakeholderima treba da definiše krupne ideje za softver (epic-e).', false, 'Izjava nije istinita. U opštem slučaju je product owner taj koji će formirati viziju softvera i njegove krupne celine. U određenim (često manjim) organizacijama je čitav tim uključen u ovaj proces.', -983);
