INSERT INTO public."MrqItems"("Id", "Text", "IsCorrect", "Feedback", "MrqId") VALUES
	(-9822, '"Scope creep" podrazumeva da se uvuku korisničke priče koje opisuju manje bitne funkcionalnosti u sprint backlog.', true, 'Izjava je istinita. "Scope" definiše opseg posla koji se radi. "Creep" nagovešatava da se nešto provlači iako ne bi trebalo. "Scope creep" se odnosi na punjenje backloga nebitnim zahtevima koji otežavaju održavanje backlog-a i potencijalno usporavaju razvoj.', -982);
