Programi rade sa podacima tako što primenjuju jednu ili više **operacija** nad njima.
## Šta je operacija?
Pre nego što definišemo šta je operacija, sagledajmo jedan primer. **Sabiranje** je **operacija** koja ima sledeće elemente:

- Dva podatka (broja) koji se sabiraju (**ulazni podaci**).
- **Operator** `+` koji određuje operaciju.
- Rezultujući podatak (broj), čija vrednost je jednaka sumi (**izlazni podatak**).

Oduzimanje je slična operacija, gde *operator* `-` određuje operaciju i konačni rezultat je jednak razlici dva broja.

Iz navedenog, možemo definisati **operaciju** kao naredbu koja ima sledeće elemente:

 - Jedan ili više **ulaznih podataka** koje obrađuje.
 - **Operator** koji određuje operaciju.
 - **Izlazni podatak** koji predstavlja rezultat operacije.');


