 - Šta je skup operacija koje se mogu primeniti nad tim vrednostima i kako se operacije ponašanju?

Ovde razmatramo šta predstavlja skup mogućih vrednosti za pomenuta 3 tipa podatka.
### Skup mogućih vrednosti tipa podataka
Za tip podatka **ceo broj** podrazumevamo skup mogućih vrednosti koji uključuje pozitivne i negativne cele brojeve, poput `-134567`, `-1`, `0`, `33`, `3214545566`.

Za tip podatka **decimalan broj** podrazumevamo skup mogućih vrednosti koji uključuje pozitivne i negativne decimalne brojeve, poput `-123.456`, `-2.5`, `0.0001` i `3.14159265`.

Za tip podatka **tekst** podrazumevamo skup mogućih vrednosti koji uključuje niz karaktera smeštenih između navodnika, poput `"a"`, `"-5.5"`, `"testiram ispis"` i `"Republika Srbija je suverena drzava koja se nalazi na raskrsnici puteva srednje i jugoistocne Evrope."`.');


 - Šta je skup mogućih vrednosti datog tipa podatka?
 - **Šta je skup operacija koje se mogu primeniti nad tim vrednostima i kako se operacije ponašanju?**

Ovde razmatramo **aritmetičke operacije** (sabiranje, oduzimanje, množenje i deljenje) i kako se one ponašaju u radu sa različitim tipovima podataka.
### Aritmetičke operacije
Aritmetičke operacije se smisleno mogu koristiti nad celim brojevima i nad decimalnim brojevima.

Analiziraj sledeći kod:
```java
System.out.println(50 + 5);
System.out.println(50 - 10);
System.out.println(50 * 2);
System.out.println(50 / 4);
```
U kodu iznad pronalazimo četiri naredbe za ispis. Unutar svake naredbe se nalazi naredba za odgovarajuću aritmetičku operaciju (redom - sabiranje, oduzimanje, množenje i deljenje). Za dati kod, očekivali bismo da ispis bude:
```java
55
40
100
12.5
```
Međutim, ako bismo pokrenuli ovaj kod pronašli bismo da je ispis:
```java
55
40
100
12
```
Iako se u četvrtoj liniji koda koristi operator `/` koji određuje da je operacija deljenja u pitanju, brojevi koji se dele su **tipa celog broja**. Operacija deljenja je za ovaj tip podatka drugačije definisana od klasičnog deljenja. Rezultujući podatak je isto ceo broj i jednak je rezultatu deljenja gde se zanemaruje ostatak pri deljenju.

Za razliku od deljenja, ostale aritmetičke operacije (sabiranje, oduzimanje i množenje) se ponašaju kako bismo očekivali kada rade sa tipom podataka ceo broj.

Ako bismo želeli da dobijemo preciznije deljenje, morali bismo da radimo sa tipom podatka **decimalan broj**, koga definišemo uz pomoć tačke. Na primer, umesto `5` pišemo `5.0`.

Analiziraj sledeći kod:

```java
System.out.println(50.0 + 5);
System.out.println(50.0 - 10);
System.out.println(50.0 * 2);
System.out.println(50.0 / 4);
```
Za dati kod će ispis biti:
```java
55.0
40.0
100.0
12.5
```
Sada imamo očekivani rezultat. Obrati pažnju da kod  ` System.out.println(50.0 + 5);` vrši sabiranje podatka koji je decimalan broj `50.0` i podatka koji je ceo broj `5`. Dakle, **ulazni podaci** su različitog tipa, a vidimo da je izlazni podatak `55.0`, odnosno decimalan broj. Iz navedenog vidimo kako se aritmetičke operacije ponašaju.');


 - Šta je skup mogućih vrednosti datog tipa podatka?
 - **Šta je skup operacija koje se mogu primeniti nad tim vrednostima i kako se operacije ponašanju?**

Ovde razmatramo **relacione operacije** (manje, veće, jednako, različito) i kako se one ponašaju u radu sa različitim tipovima podataka.
### Relacione operacije
Relacione operacije se smisleno mogu koristiti nad celim brojevima i nad decimalnim brojevima.

Analiziraj sledeći kod:
```java
System.out.println(5 < 8);
System.out.println(5 > 8);
System.out.println(5 == 8);
System.out.println(5 != 8);
```
U kodu iznad pronalazimo četiri naredbe za ispis. Unutar svake naredbe se nalazi naredba za odgovarajuću relacionu operaciju. To su redom:
- Manje, definisano operatorom `<`,
- Veće, definisano operatorom `>`,
- Jednako, definisano operatorom `==` i
- Različito, definisano operatorom `!=`.

U sva četiri slučaja vidimo da su **ulazni podaci** celi brojevi. Postavlja se pitanje šta je **izlazni podatak** i kog je on tipa?

Ako bismo pokrenuli kod, ispis bi bio sledeći:

```java
true
false
false
true
```
Pošto je `5` stvarno manje i različito od `8` ispis za te dve naredbe je istina, odnosno `true`. Pošto bi bilo pogrešno da kažemo da je `5` veće od `8` ili da je jednako `8` ispisi za te dve naredbe su neistina, odnosno `false`. Ovde vidimo novi tip podatka - **logički tip podatka** koji ima samo dve moguće vrednosti `true` i `false`.');


 - Šta je skup mogućih vrednosti datog tipa podatka?
 - **Šta je skup operacija koje se mogu primeniti nad tim vrednostima i kako se operacije ponašanju?**

Ovde razmatramo **logičke operacije** (logičko i, logičko ili, logičko ne) i kako se one ponašaju u radu sa logičkim vrednostima **true** i **false**.
### Logičke operacije
Logičke operacije se smisleno koriste isključivo nad logičkim vrednostima. Postoje tri vrste logičkih operacija: logičko i, logičko ili, logičko ne.

**Logičko i** je definisano opetarom `&&`.  Analiziraj sledeći kod:
```java
System.out.println(true && true);
System.out.println(true && false);
System.out.println(false && true);
System.out.println(false && false);
```
U kodu iznad pronalazimo četiri naredbe za ispis. Unutar svake naredbe se nalazi operacija **logičko i**. U sva četiri slučaja vidimo da su **ulazni podaci** logička vrednost (`true` ili `false`). Postavlja se pitanje šta je **izlazni podatak** i kog je on tipa?

Ako bismo pokrenuli kod, ispis bi bio sledeći:

```java
true
false
false
false
```
Vidimo da je **izlazni podatak** logička vrednost. Takođe vidimo da operacija **logičko i** kao rezultat daje `true` samo ako su oba **ulazna podatka** `true`.

**Logičko ili** je definisano opetarom `||`.  Analiziraj sledeći kod:
```java
System.out.println(true || true);
System.out.println(true || false);
System.out.println(false || true);
System.out.println(false || false);
```
U kodu iznad pronalazimo četiri naredbe za ispis. Unutar svake naredbe se nalazi operacija **logičko ili**. U sva četiri slučaja vidimo da su **ulazni podaci** logička vrednost (`true` ili `false`). Postavlja se pitanje šta je **izlazni podatak** i kog je on tipa?

Ako bismo pokrenuli kod, ispis bi bio sledeći:

```java
true
true
true
false
```
Vidimo da je **izlazni podatak** logička vrednost. Takođe vidimo da operacija **logičko ili** kao rezultat daje `false` samo ako su oba **ulazna podatka** `false`.

**Logičko ne** je definisano opetarom `!`. Razlikuje se od ostalih operacija zato što ima **jedan ulazni podataka**. Analiziraj sledeći kod:
```java
System.out.println(!true);
System.out.println(!false);
```
U kodu iznad pronalazimo četiri naredbe za ispis. Unutar prve dve  naredbe se nalazi **logičko ne**.  Postoji jedan **ulazni podatak** koji je logička vrednost koja se navodi posle operatora `!`. Postavlja se pitanje šta je **izlazni podatak** i kog je on tipa?

Ako bismo pokrenuli kod, ispis bi bio sledeći:

```java
false
true
```
Vidimo da je **izlazni podatak** logička vrednost. Takođe vidimo da operacija **logičko ne** kao rezultat daje suprotnu logičku vrednost, odnosno ako je ulaz `false` izlaz je `true`. Ako je ulaz `true` izlaz je `false`.');








