Dok se upoznajemo sa promenljivom tražimo odgovore na pitanja:
- Šta je promenljiva i zašto nam je potrebna?
- Kako se upisuje vrednost u promenljivu?
- Kako se čita vrednost koja je smeštena u promenljivu?

Na samom kraju ćemo analizirati složenije kodove koji kombinuju sve navedeno.', -99);


- Prvo se upoznajemo sa vrstom naredbe koja će omogućiti našem programu da pročita podatak sa tastature.
- Zatim ćemo dopuniti kolekciju mogućih operacija sa katalogom matematičkih funkcija (npr. sinus, kosinus) koji nam koriste za razne geodetske proračune.

Na kraju ćemo sabrati sve što smo do sada naučili kroz složenije zadatke. Analiziraćemo tekstove zadataka i razmatrati kakvi kodovi odgovaraju na njih.', -99);








Promenljivu možemo posmatrati kao *kutiju* u koju možemo da smestimo *jedan predmet* u jednom momentu (**upišemo vrednost**). Promenljivu koristimo na 3 različita načina u kodu:

1. **Definisanje promenljive** se radi jednom za svaku promenljivu i podrazumeva isticanje **tipa podatka** koji možemo da upišemo u promenljivu i navođenja **jedinstvenog naziva**.
**Primer**: `int a;`.
2. **Upis vrednosti u promenljivu**, gde odabranu vrednost "ubacujemo u kutiju", odnosno smeštamo da se sačuva u promenljivu. Svaki upis u promenljivu briše podatak koji se prethodno nalazio u njoj.
**Primer**: `a = 5;`.
Neophodno je da promenljiva bude **definisana** pre nego što se može upisati podatak u nju. Moguće je prilikom definisanja upisati početnu vrednost u promenljivu.
**Primer**: `int b = 10;`.
3. **Čitanje vrednosti iz promenljive**, gde želimo da "proverimo šta se nalazi u kutiji", odnosno da iskoristimo podatak koji je smešten u promenljivi u nekoj naredbi.
**Primer**: `System.out.println(a + b);`.

Bitni elementi promenljive su:

 - **Naziv**, koji koristimo svaki put kada hoćemo da upišemo neki podatak u promenljivu ("stavimo nešto u kutiju") ili kada hoćemo da vidimo koji podatak je već smešten u promenljivu ("proverimo šta se nalazi u kutiji").
 - **Dozvoljen tip podatka**, kojim je određeno kakav podatak može da se smesti u promenljivu. Tako će kod `String a = 5.5;` da rezultuje greškom jer nije ispoštovano navedeno pravilo.
 - **Sačuvan podatak**, gde promenljiva u svakom momentu ima neki podatak sačuvan u sebi. Kada se promenljiva **pročita**, program će dobiti sačuvan podatak, a kada program **piše** novi podatak u promenljivu obrisaće stari.');

Programi rade sa podacima često kroz upotrebu **promenljivih**. Promenljivu možemo posmatrati kao **kutiju** u koju možemo da smestimo **jedan predmet** u jednom momentu. Na kutiju možemo zapisati **naziv** (npr. "slike letovanja"). Takođe možemo reći da kutija ima namenu u vidu **tipa** predmeta koji skladišti. Na primer, u kutiju za naočare možemo smestiti naočare za čitanje ili naočare za sunce, ali ne možemo da smestimo cipelu.

Bitno je da zapamtiš sledeće osobine promenljive:

 - Svaka promenljiva ima **naziv** koji mora biti jedinstven i koji se sastoji od malih i velikih slova. Poželjno je da naziv precizno odredi smisao podataka koji se "smeštaju u kutiju". Na primer, ako promenljiva treba da sačuva broj radnika nekog preduzeća, ima smisla da se zove `brojRadnika`.
 - Svaka promenljiva u jednom momentu sadrži **jedan podatak**. Ako se smesti novi podatak u kutiju stari nestaje.
 - Svaka promenljiva definiše **tip podatka** koji sme da se sačuva u nju. Na primer, ako definišemo da promenljiva `brojRadnika` skladišti ceo broj možemo u kodu da ubacimo novi ceo broj u tu kutiju, ali ne možemo da postavimo tekst u tu kutiju.

## Zašto je programu potrebna promenljiva?
Programi su glupavi. Njihova snaga je u tome što mogu da rade 24 sata svaki dan, a kada ih naučimo da rade neki posao oni to rade bez greške. Međutim, mogu samo proste zadatke da urade u jednoj naredbi i moramo im objasniti kroz mnogo postepenih koraka kako da urade nešto pametno. Jedan takav sitan korak je "*imaj ovaj podataka na umu*".

Zamisli magacionera koji stoji u skladištu sa mnoštvom kutija. Dobio je tonu papira koje treba da pročita, gde svaki sadrži jednu objavu sa *Twitter*a. Zadatak mu je da izbroji koliko objava se bavi sportom, koliko biznisom, a koliko psihologijom. Ovaj posao izdeli u sledeće korake:

 - Uzima  3 kutije u koje mogu da stanu papiri (*definiše 3 promenljive, gde svaka prihvata "papir" tip podatka*). Markerom upisuje "Biznis" na lice jedne kutije, "Psihologija" na lice sledeće, a za treću ispisuje "Sport" (*dodeljuje jedinstveni naziv svakoj promenljivoj*).
 - Redom čita papire i razmišlja da li pripadaju prvoj, drugoj ili trećoj kategoriji (*vrši odlučivanje, koje ćemo učiti za nekoliko lekcija*).
 - Kada odluči, ubacuje papir u odgovarajuću kutiju i pored naziva lupa recku (*ubacuje vrednost u promenljivu*).
 - Kada prođe kroz sve papire sumira recke za svaku kutiju.
 - Uzima prazan papir i upisuje tri reda:
    ```
   Ukupno biznis: ___
   Ukupno psihologija: ___
   Ukupno sport: ___
   ```
   (*definiše tri promenljive `ukupnoBiznis`, `ukupnoPsihologija`, `ukupnoSport` i predviđa da smesti cele brojeve u svaku*).
 - Upisuje markerom konačnu sumu za svaku kutiju (*ubacuje vrednost u svaku od tri promenljive*).

## Kako se definiše promenljiva u kodu?
Analiziraj sledeći kod:
```java
int brojRadnika = 50;
double prosecnaPlata = 802.25;
String nazivFirme = "FTN";
boolean poceoSemestar = true;
```
U navedenim linijama koda **definišemo** četiri promenljive:
1. promenljiva sa **nazivom** `brojRadnika` prihvata **tip podatka** koji je ceo broj `int`. U datu promenljivu je **upisan podatak** čija vrednost je 50 `= 50;`
2. promenljiva sa **nazivom** `prosecnaPlata` prihvata **tip podatka** koji je decimalan broj `double`. U datu promenljivu je **upisan podatak** čija vrednost je 802.25 `= 802.25;`
3. promenljiva sa **nazivom** `nazivFirme` prihvata **tip podatka** koji je tekst `String`. U datu promenljivu je **upisan podatak** čija vrednost je "FTN" `= "FTN";`
4. promenljiva sa **nazivom** `poceoSemestar` prihvata **tip podatka** koji je lokička vrednost `boolean`. U datu promenljivu je **upisan podatak** čija vrednost je true `= true;`');

Analiziraj sledeći kod:
```java
int procenatGoriva = 60;
procenatGoriva = 45;
procenatGoriva = 30;
```
U prvoj liniji koda se **definiše** promenljiva sa *nazviom*  `procenatGoriva` i **upisuje** se podatak `60` u nju.

Druga linija koda **upisuje** podatak `45` u promenljivu, čime se gubi podatak 60.

Slično se dešava sa poslednjom linijom koda, gde se upisuje `30`. Na kraju izvršavanja ovog koda se broj 30 nalazi u promenljivi i svi ostali podaci (60 i 45) su nestali.

Iz navedenog vidimo da znak jednakosti `=` određuje operaciju upisa u promenljivu, gde je neophodno da naziv promenljive bude sa leve strane, a vrednost koju hoćemo da upišemo u nju sa desne. Ova vrednost može da bude direktno napisan podatak kao u primerima, ali i rezultat neke naredbe. Na primer:
```java
int procenatGoriva = 0.6 * 100;
```');


Analiziraj sledeći kod:
```java
int procenatGoriva = 60;
System.out.println(procenatGoriva);
```
Prva linija koda **definiše** promenljivu sa **nazivom** `procenatGoriva` i **upisuje** podatak `60` u nju.

Druga linija koda predstavlja naredbu za ispis vrednosti koja se nalazi između zagrada. Vidimo da je između zagrada navedena promenljiva `procenatGoriva`. Ovako govorimo programu da **pročita** podatak koji je smešten u promenljivi i da taj podatak onda ispiše. Za dati kod ispis bi bio:
```java
60
```
### Čitanje i upotreba vrednosti iz više promenljivih
Analiziraj sledeći kod:
```java
