Razumevanje teksta zadatka i njegovo razlaganje u manje celine koje se potom mogu pretvoriti u kod je veština za sebe. U ovom segmentu ćemo da analiziramo tekstove različitih zadataka i da vidimo kako možemo sve što smo do sada naučili da iskoristimo za rešavanje datih zadataka.

Analiziraj tekst zadatka:

 - *Napisati program koji prikazuje na konzoli poruku da je program aktivan, nakon čega traži unos jednog broja sa tastature. Kada korisnik unese broj, dati broj je potrebno prikazati na konzoli. Od korisnika se zahteva unos drugog broja, koji se takođe ispisuje na konzoli. Najzad, program treba da ispiše zbir unetih brojeva na konzoli.*

Dobra praksa, posebno dok još nismo razvili veštinu analiziranja teksta zadatka, je da pokušamo da pretvorimo tekst zadatka u tezice koje program treba da uradi. Tako možemo prethodni tekst da transformišemo u sledeći oblik:
 - *Napisati program koji:*
	 1. *prikazuje na konzoli poruku da je program aktivan*
	 2. *traži unos jednog broja sa tastature*
	 3. *broj je potrebno prikazati na konzoli.*
	 4. *zahteva unos drugog broja*
	 5. *koji se takođe ispisuje na konzoli.*
	 6. *treba da ispiše zbir unetih brojeva na konzoli.*

Razlaganjem zadatka na sitnije korake možemo lakše da vidimo koje naredbe u programu treba napisati da bi rešili pojedinačne sitne korake. Da bismo rešili prvi korak, potrebna nam je naredba za ispis, odnosno `System.out.println("Program je aktivan");`.

Ako sagledamo kompletan program, za sada imamo sledeći kod:
```java
package zadaci;

public class SabiranjeBrojeva {
    public static void main(String[] args) {
        System.out.println("Program je aktivan");
    }
}
```
Sledeće je potrebno napisati kod koji *traži unos jednog broja sa tastature*. Iz prethodnog segmenta znamo da je za unos sa tastature potrebno:
- Napisati `import java.util.Scanner;` ispod `package` linije.
- Napisati `Scanner scanner = new Scanner(System.in);` na početku našeg koda.
- Napisati `scanner.nextInt();` (pošto radimo sa celim brojevima) i smestiti rezultat u neku promenljivu.

Kod sada ima sledeći izgled:
```java
package zadaci;
import java.util.Scanner;

public class SabiranjeBrojeva {
	public static void main(String[] args) {
	    Scanner scanner = new Scanner(System.in);
        
        System.out.println("Program je aktivan");
        
		int prvi = scanner.nextInt();

	}
}
```
Sada možemo da ispunimo zahtev *broj je potrebno prikazati na konzoli*. Sledeći kod prikazuje broj, uz prefiks `"Vrednost prvog broja je "`:
```java
package zadaci;
import java.util.Scanner;

public class SabiranjeBrojeva {
	public static void main(String[] args) {
	    Scanner scanner = new Scanner(System.in);
        
        System.out.println("Program je aktivan");
        
		int prvi = scanner.nextInt();
        System.out.println("Vrednost prvog broja je " + prvi);
	}
}
```
Po sličnom principu možemo da rešimo 4. (unos drugog broja sa tastature) i 5. (ispis tog broja) sitan korak. Kod ima sledeći izgled:
```java
package zadaci;
import java.util.Scanner;

public class SabiranjeBrojeva {
	public static void main(String[] args) {
	    Scanner scanner = new Scanner(System.in);
        
        System.out.println("Program je aktivan");
        
		int prvi = scanner.nextInt();
        System.out.println("Vrednost prvog broja je " + prvi);

        int drugi = scanner.nextInt();
        System.out.println("Vrednost drugog broja je " + drugi);
	}
}
```
Vredi istaći da je za unos drugog broja sa tastature dovoljan novi poziv `scanner.nextInt();` i da nije bilo potrebno dodatan `import java.util.Scanner;` ili `new Scanner(...)`. Najzad, možemo da ispunimo poslednji korak *treba da ispiše zbir unetih brojeva na konzoli.*

Konačan kod ima sledeći izgled:
```java
package zadaci;
import java.util.Scanner;

public class SabiranjeBrojeva {
	public static void main(String[] args) {
	    Scanner scanner = new Scanner(System.in);
        
        System.out.println("Program je aktivan");
        
		int prvi = scanner.nextInt();
        System.out.println("Vrednost prvog broja je " + prvi);

        int drugi = scanner.nextInt();
        System.out.println("Vrednost drugog broja je " + drugi);
        
        System.out.println("Suma je " + (prvi+drugi));
	}
}
```
Obrati pažnju da smo morali `prvi+drugi` da stavimo u zagradu kako bi se desilo sabiranje brojeva umesto da se vrednost u `prvi` promenljivi spoji sa tekstom `"Suma je "`, pa da se na taj spojen tekst doda vrednost smeštena u `drugi` promenljivoj.

