Programi rade sa podacima. Izvor tih podataka mogu da budu datoteke koje program čita. Drugi čest izvor su sami korisnici aplikacije i podaci koje unose putem tastature ili miša. Na primer, kada uneseš poruku na društvenoj mreži poput *Facebook*a, tekst tvoje poruke obrađuje program koji čuva tvoju poruku i prosleđuje je odgovarajućoj osobi ili grupi. Ta poruka je podatak koji si uneo putem tastature.

### Kako Java program čita podatke sa tastature?
Analiziraj sledeći kod:
```java
package tastatura;

import java.util.Scanner; // Obrati paznju

public class PrimerSaTastaturom {

	public static void main(String[] args) {
		Scanner scanner = new Scanner(System.in); // Obrati paznju
		
		int ceoBroj = scanner.nextInt(); // Obrati paznju
		
		System.out.println(ceoBroj);
	}

}
```
Ako bismo pokrenuli naveden program u *Eclipse* alatu, videli bismo da se "ništa ne dešava". Program zapravo čeka da korisnik unese broj. Potrebno je da kliknemo na konzolu i da potom unesemo neki ceo broj (npr. 5). Kada stisnemo *Enter* konzola će ispisati broj koji smo uneli.

Ako analiziraš kod iznad, primetićeš da na tri mesta stoji komentar `// Obrati paznju`. Da bismo osposobili Java program da radi sa tastaturom, neophodno je uraditi 3 stvari:

1. Između naziva paketa i klase pišemo `import java.util.Scanner;`.
2. Na početku mesta gde pišemo kod navodimo `Scanner scanner = new Scanner(System.in);`
3. U momentu kada želimo da korisnik unese podatak sa tastature definišemo promenljivu ili koristimo postojeću, gde želimo da **upišemo** u nju podatak koji korisnik unosi sa tastature (**linija 10**).
a. Ako želimo da korisnik unese ceo broj, pišemo `scanner.nextInt();` posle znaka jednakosti.
b. Ako želimo da korisnik unese decimalan broj, pišemo `scanner.nextDouble();` posle znaka jednakosti.
c. Ako želimo da korisnik unese tekst, pišemo `scanner.next();` posle znaka jednakosti.
**Bitno je da promenljiva može da skladišti navedeni tip podatka.**

Bitno je istaći da je korake 1 i 2 potrebno uraditi samo jednom. Korak 3 ponavljamo za svaki unos sa tastature koji želimo od našeg korisnika. Analiziraj sledeći kod:
```java
package tastatura;

import java.util.Scanner;

public class PrimerSaTastaturom {

	public static void main(String[] args) {
		Scanner scanner = new Scanner(System.in);
		
		int prviBroj = scanner.nextInt(); // Obrati paznju
        int drugiBroj = scanner.nextInt(); // Obrati paznju
		
		System.out.println(prviBroj - drugiBroj);
	}
}
```
U datom programu, korisnik unosi dva broja, gde se na kraju ispisuje njihova razlika. Iako se dva puta unosi broj sa tastature, `import java.util.Scanner;` je urađen samo jednom, kao i `Scanner scanner = new Scanner(System.in);`. Ključno je da je `scanner.nextInt();` aktiviran dva puta, gde je rezultat prvog čitanja sačuvan u promenljivu `prviBroj`, a rezultat drugog čitanja u promenljivu `drugiBroj`.');

Matematika je bitan deo programiranja. Sa jedne strane, matematičko razmišljanje pomaže da bolje razumemo koncepte u programiranju i razlažemo zadatke na sitnije korake koje pretvaramo u kod. Sa druge strane, često pišemo kod koji obrađuje nekakve podatke koristeći matematičke operacije. Aritmetičke operacije (+, -, *, /) su primer matematičkih operacija.

Postavlja se pitanje kako možemo da primenimo trigonometrijske operacije, korenovanje ili druge operacije koje nisu jednostavna aritmetika? Odgovor je `Math` biblioteka.

### Kako izgleda `Math` u kodu?
Za razliku od aritmetičkih, relacionih i logičkih operacija, operacije koje definiše `Math` biblioteka ne aktiviram uz pomoć operatora. Umesto toga, pozivamo odgovarajuću funkciju nad bibliotekom, kao što kod ispod prikazuje:

```java
public static void main(String[] args) {
  int a = 3;
  int b = 4;
  double c = Math.sqrt(a*a + b*b);
  System.out.println("Hipotenuza je: " + c);
}
```
Linija 4 je interesantna i prikazuje funkciju korenovanja. Ulazni podatak se navodi između zagrada i predstavlja rezultat sabiranja članova `a*a` i `b*b`. Izlazni podatak je koren datog broja i njega čuvamo u promenljivu `c`.

Po uzoru na prethodni kod možemo napisati program koji računa stranicu trougla putem *kosinusne teoreme*. Po ovoj teoremi, možemo sračunati treću stranicu (a) trougla kada su nam poznate dve stranice (b, c) i ugao između njih (α). Formula je:

- a^2^ = b^2^ + c^2^ + 2 * b * c * cos (α)

Kod koji implementira datu računicu ima sledeći izgled:
```java
public static void main(String[] args) {
  int b = 3;
  int c = 4;
  double alpha = Math.toRadians(30);
  double a = Math.sqrt(Math.pow(b,2) + Math.pow(c,2) + 2*b*c*Math.cos(alpha));
  System.out.println("Duzina trece stranice je: " + a);
}
```
Prethodni kod koristi 4 različite operacije definisane u okviru `Math` biblioteke:
- `toRadians` u 4. liniji koda prihvata broj koji predstavlja ugao u stepenima kao ulazni podatak i daje ugao u radijanima kao izlani podatak.
- `sqrt` smo već razmotrili u prethodnom primeru. Interesantan detalj 5. linije je koliko je složena naredba koja će kao konačni rezultat da formira ulazni podatak za operaciju `sqrt`.
- `pow` u 5. liniji koda prihvata dva broja kao ulazne podatke. Prvi broj je broj koji želimo da stepenujemo, a drugi broj je vrednost stepena. U ovom slučaju stavljamo vrednost u promenljivi `b` na stepen `2`, odnosno kvadriramo taj broj.
- `cos` u 5. liniji koda prihvata broj koji predstavlja ugao u radijanima kao ulazni podatak i daje kosinus tog ugla kao izlazni podatak.
### Koje sve operacije podržava `Math` biblioteka?
`Math` biblioteka sadrži mnoštvo funkcija (preko 35) koje se bave trigonometrijom, stepenovanjem, logaritmima itd. Mi ćemo koristiti mali podskup, gde su nam interesantne trigonometrijske funkcije i stepenovanje i korenovanje. Za pun spisak pogledaj sledeći [link](https://www.w3schools.com/java/java_ref_math.asp).');


